import axios from "axios";
import React, { useCallback, useEffect, useState } from "react";
import Dog from "../models/dog";
import DogCard from "../components/DogCard"
import { Button, FormControl, Grid, InputLabel, MenuItem, Select, TextField } from "@mui/material";
import { useNavigate } from 'react-router-dom';
import BasicPaginator from "../components/paginator";

export default function IndexPage() {

    const [dogs, setDogs] = useState<Dog[]>([])
    const navigate = useNavigate();

    useEffect(() => {
        fetchDogSearchResults(0);
    }, []);

    const handlePageChange = useCallback((event: React.ChangeEvent<unknown>, value: number) => {
        fetchDogSearchResults(value);
    }, [BasicPaginator]);

    const fetchDogSearchResults = (pageNumber: Number) => {
        axios.get(`https://api.thedogapi.com/v1/images/search?limit=8&page=${pageNumber}&order=Desc`)
            .then(response => {
                //var currentdogs = [...dogs];
                //currentdogs = currentdogs.concat(response.data);
                setDogs(response.data);
            })
            .catch(error => {
                console.error('There was an error!', error);
            });
    }

    const fetchDogBreedResults = (pageNumber: Number) => {
        axios.get(`https://api.thedogapi.com/v1/images/search?limit=8&page=${pageNumber}&order=Desc`)
            .then(response => {
                //var currentdogs = [...dogs];
                //currentdogs = currentdogs.concat(response.data);
                setDogs(response.data);
            })
            .catch(error => {
                console.error('There was an error!', error);
            });
    }

    const navigateToFavourites = () => {
        debugger;
        navigate('favourites');
    }
    const searchType: string = "10";
    const handleChange = () => {

    }
    return (
        <div style={{ width: "80%", marginLeft: "13%" }}>
            <div style={{ margin: "40px" }}>
                <Button
                    onClick={() => { navigateToFavourites() }}
                >
                    Favourites
                </Button>
                <FormControl>
                    <InputLabel id="demo-simple-select-label">Search By Breed</InputLabel>
                    <Select
                        labelId="demo-simple-select-label"
                        id="demo-simple-select"
                        value={searchType}
                        label="Search By Breed"
                        onChange={handleChange}

                        style={{ width: "150px" }}
                    >
                        <MenuItem value={10}>Ten</MenuItem>
                        <MenuItem value={20}>Twenty</MenuItem>
                        <MenuItem value={30}>Thirty</MenuItem>
                    </Select>
                </FormControl>
            </div>
            <div style={{ display: "flex", flexWrap: "wrap" }}>
                {
                    dogs && dogs.length > 0 ? dogs.map((dog, index) => {
                        return (<DogCard url={dog.url} id={dog.id}
                            title={dog.breeds[0]?.name}
                            description={dog.breeds[0]?.bred_for} />)
                    }) : null
                }
            </div>
            <Stack spacing={2} style={{
                display: "block",
                marginLeft: "auto",
                marginRight: "auto",
                width: "40%",
                marginTop: "20px"
            }}>
                <Pagination count={10} page={page} onChange={handlePageChange} size="large" />
            </Stack>
        </div>
    );
}
